import React from "react";
import TopBar from "./TopBar";
import Register from "./Register";
import Home from "./Home";
import {
  BrowserRouter as Router,
  Switch,
  Route, 
  Link
} from "react-router-dom";

export default function App() {
  return (
    <Router>
      <TopBar />
      <Switch>
        <Route path="/">
        <Home />
        </Route>
      </Switch>
     <Register />
     </Router>
  );
}
